// Enhanced job data processing with better HTML parsing
const allJobs = [];
let jobId = 1;

// Process each input from scrapers
for (const input of $input.all()) {
  try {
    const htmlContent = input.json.data || input.json || '';
    const nodeName = input.node ? input.node.name : 'unknown';
    const source = nodeName.toLowerCase().includes('linkedin') ? 'linkedin' : 
                  nodeName.toLowerCase().includes('indeed') ? 'indeed' : 
                  nodeName.toLowerCase().includes('jobstreet') ? 'jobstreet' : 'unknown';

    console.log(`Processing ${source} data, content length: ${htmlContent.length}`);

    // Enhanced regex patterns for better job extraction
    const patterns = {
      linkedin: {
        title: /<h3[^>]*class[^>]*job-result-card__title[^>]*>\s*<a[^>]*>([^<]+)<\/a>\s*<\/h3>/gi,
        company: /<h4[^>]*class[^>]*job-result-card__subtitle[^>]*>\s*<a[^>]*>([^<]+)<\/a>/gi,
        location: /<span[^>]*class[^>]*job-result-card__location[^>]*>([^<]+)<\/span>/gi
      },
      indeed: {
        title: /<h2[^>]*class[^>]*jobTitle[^>]*>\s*<a[^>]*><span[^>]*>([^<]+)<\/span><\/a>\s*<\/h2>/gi,
        company: /<span[^>]*class[^>]*companyName[^>]*>([^<]+)<\/span>/gi,
        location: /<div[^>]*class[^>]*companyLocation[^>]*>([^<]+)<\/div>/gi
      },
      jobstreet: {
        title: /<h1[^>]*class[^>]*job-title[^>]*>([^<]+)<\/h1>/gi,
        company: /<span[^>]*class[^>]*company-name[^>]*>([^<]+)<\/span>/gi,
        location: /<span[^>]*class[^>]*job-location[^>]*>([^<]+)<\/span>/gi
      }
    };

    // Use appropriate pattern based on source
    const sourcePatterns = patterns[source] || patterns.linkedin;

    // Extract job data using regex
    const titleMatches = [...htmlContent.matchAll(sourcePatterns.title)];
    const companyMatches = [...htmlContent.matchAll(sourcePatterns.company)];
    const locationMatches = [...htmlContent.matchAll(sourcePatterns.location)];

    // Process extracted matches
    titleMatches.forEach((match, index) => {
      if (match[1] && match[1].trim().length > 3) {
        const jobTitle = match[1].trim().replace(/\s+/g, ' ');

        // Filter for relevant tech jobs
        const techKeywords = ['engineer', 'developer', 'programmer', 'analyst', 'scientist', 'architect', 'manager', 'lead', 'senior', 'junior'];
        const isRelevantJob = techKeywords.some(keyword => 
          jobTitle.toLowerCase().includes(keyword)
        );

        if (isRelevantJob) {
          allJobs.push({
            id: `${source}_${jobId++}_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,
            title: jobTitle,
            company: companyMatches[index] ? companyMatches[index][1].trim() : `Company from ${source}`,
            location: locationMatches[index] ? locationMatches[index][1].trim() : 
                     $('Set Search Configuration').first().json.location.split(' OR ')[0],
            link: `https://${source}.com/job/${jobId}`,
            source: source,
            scraped_at: new Date().toISOString(),
            keywords_matched: $('Set Search Configuration').first().json.keywords
          });
        }
      }
    });
  } catch (error) {
    console.error(`Error processing ${input.node ? input.node.name : 'unknown'} data:`, error.message);
  }
}

// Add sample jobs if no real jobs found (for testing)
if (allJobs.length === 0) {
  console.log('No jobs found from scraping, adding sample data for testing');

  const sampleJobs = [
    {
      id: `sample_linkedin_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,
      title: "Senior Software Engineer - Backend",
      company: "Tech Innovators Indonesia",
      location: "Jakarta",
      link: "https://linkedin.com/jobs/view/sample1",
      source: "linkedin",
      scraped_at: new Date().toISOString(),
      keywords_matched: $('Set Search Configuration').first().json.keywords
    },
    {
      id: `sample_indeed_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,
      title: "Data Scientist - Machine Learning",
      company: "AI Solutions Corp",
      location: "Bandung",
      link: "https://indeed.com/jobs/view/sample2",
      source: "indeed",
      scraped_at: new Date().toISOString(),
      keywords_matched: $('Set Search Configuration').first().json.keywords
    },
    {
      id: `sample_jobstreet_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`,
      title: "Full Stack Developer - React & Node.js",
      company: "Digital Startup Ltd",
      location: "Surabaya",
      link: "https://jobstreet.co.id/jobs/view/sample3",
      source: "jobstreet",
      scraped_at: new Date().toISOString(),
      keywords_matched: $('Set Search Configuration').first().json.keywords
    }
  ];
  allJobs.push(...sampleJobs);
}

// Advanced deduplication logic
const uniqueJobs = [];
const seenTitles = new Set();

allJobs.forEach(job => {
  // Normalize title for comparison
  const normalizedTitle = job.title
    .toLowerCase()
    .replace(/[^a-z0-9\s]/g, '')
    .replace(/\s+/g, ' ')
    .trim();

  // Check for similarity with existing jobs
  let isDuplicate = false;
  for (const seenTitle of seenTitles) {
    // Simple similarity check (can be enhanced with Levenshtein distance)
    const commonWords = normalizedTitle.split(' ').filter(word => 
      seenTitle.includes(word) && word.length > 3
    );

    if (commonWords.length >= 2) {
      isDuplicate = true;
      break;
    }
  }

  if (!isDuplicate) {
    seenTitles.add(normalizedTitle);
    uniqueJobs.push(job);
  }
});

console.log(`Total jobs scraped: ${allJobs.length}`);
console.log(`Unique jobs after deduplication: ${uniqueJobs.length}`);
console.log(`Jobs by source: LinkedIn: ${allJobs.filter(j => j.source === 'linkedin').length}, Indeed: ${allJobs.filter(j => j.source === 'indeed').length}, JobStreet: ${allJobs.filter(j => j.source === 'jobstreet').length}`);

return uniqueJobs.map(job => ({ json: job }));

// Enhanced error handling and logging system
const inputData = $input.first().json;
const currentNode = $node.name;
const executionId = $executionId;

// Determine error source and details
let errorSource = 'unknown';
let errorMessage = 'Unknown error occurred';
let statusCode = 'N/A';
let errorDetails = {};

if (inputData) {
  errorSource = inputData.error_source || currentNode;
  errorMessage = inputData.error?.message || inputData.message || JSON.stringify(inputData).substring(0, 200);
  statusCode = inputData.statusCode || inputData.status || 'N/A';
  errorDetails = {
    original_error: inputData,
    node_name: currentNode,
    execution_context: {
      workflow_id: 'cv-screening-workflow',
      execution_id: executionId,
      timestamp: new Date().toISOString(),
      keywords_used: $node["Set Search Configuration"]?.json?.keywords || 'N/A'
    }
  };
}

// Create comprehensive error report
const errorReport = {
  error: true,
  timestamp: new Date().toISOString(),
  execution_id: executionId,
  error_source: errorSource,
  error_message: errorMessage,
  status_code: statusCode,
  error_details: errorDetails,
  workflow_step: 'AI Processing',
  retry_recommended: statusCode >= 500 || statusCode === 'N/A',
  impact_level: statusCode >= 500 ? 'high' : 'medium'
};

console.error('CV Screening Workflow Error:', errorReport);

return [{ json: errorReport }];

